import styles from './styles.module.scss'

export function SubTitle() {
  return (
    <h3 className={styles.subtitle + ' d-flex justify-content-center'}>
      The Ethereum network already facilitates countless projects with real
      world applications, further fostering innovation and adoption. Because of
      this, we believe that Ether is significantly undervalued, So PassiveSwap
      holders are rewarded with Ether reflections.
    </h3>
  )
}
